    retturn (
        <Card imgsrc={val.imgsrc}
        title={val.title}
        sname={val.sname}
        link={val.link}
       />

    )

}
 
ReactDOM.render(
    <>
    <h1  className= "heading_style">List Of Top 5 Netflix Webseries</h1>
   
   {Sdata.map(ncard)};
